basics/.body:
Basics
Make sure you've completed the setup instructions to install dependencies and get the development server running.
Now that we have set up our development environment, let's get started by creating a simple web page with an  OpenLayers map, and understand the code.
In OpenLayers, a map is a collection of layers that get rendered to a web page.  To create a map, you need some markup (HTML) that creates the map viewport (e.g. a  element), a bit of style to give the map viewport the appropriate dimensions on your page, and map initialization code.
OpenLayers supports different kinds of layers:

Tile layers for tiled raster tile sets
Image layers for static images or images that are provided on demand for the map's extent
Vector layers for vector data from static files for for the map's current extent
Vector tile layers for tiled vector tile sets

In addition to the layers and the view, a map can be configured with a set of controls (i.e. UI elements on top of the map) and interactions (i.e. components that react to touch or pointer gestures on the map).
The markup
First, we create an index.html file in the root of the workshop directory:




    OpenLayers

      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }







Note that we do not need to include any  for our application. Our webpack setup takes care of that. Our  makes the map container fill the whole page, and we will use the container  with the map-container id as target for the map.
The application
To work with OpenLayers, we install the ol package from npm. This was already done in the previous npm install step.  If you were starting from scratch on a new application, you would run npm install ol@beta this in the terminal.
As entry point of the application, we create a main.js file, and also save it in the root of the workshop directory:
import 'ol/ol.css';
import {Map, View} from 'ol';
import TileLayer from 'ol/layer/Tile';
import XYZSource from 'ol/source/XYZ';
import {fromLonLat} from 'ol/proj';

new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new XYZSource({
        url: 'http://tile.stamen.com/terrain/{z}/{x}/{y}.jpg'
      })
    })
  ],
  view: new View({
    center: fromLonLat([0, 0]),
    zoom: 2
  })
});

At the top, we import the required modules from the ol package. Note the 'ol/ol.css' import, which adds the styles that OpenLayers requires for its basic UI components. With everything we need imported, we move on and create a Map. The target points to the container  we have in our markup. We configure the map with a tiled image layer (TileLayer) and an XYZSource. Finally, the View defines the initial zoom, and the center of the map in the view projection. To provide geographic coordinates, we use the fromLonLat helper function from the ol/proj module.
Viewing the map
Now our application is ready for testing. Let's open the working map in a web browser: http://localhost:3000/. This is how it should look:
A map of the world
Further reading
In the final chapter of the workshop, we will learn how create a production build of the application for deployment.
As a starting point for your own applications, we recommend looking at the examples.
The API documentation provides reference to all classes and functions of OpenLayers.

vector/geojson.html.body:
Rendering GeoJSON
Before getting into editing, we'll take a look at basic feature rendering with a vector source and layer.  The workshop includes a countries.json GeoJSON file in the data directory.  We'll start by just loading that data up and rendering it on a map.
First, edit your index.html so we're ready to render a full page map:




    OpenLayers

      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
        background-color: #04041b;
      }







Now we'll import the three important ingredients for working with vector data:

a format for reading and writing serialized data (GeoJSON in this case)
a vector source for fetching the data and managing a spatial index of features
a vector layer for rendering the features on the map

Update your main.js to load and render a local file containing GeoJSON features:
import 'ol/ol.css';
import GeoJSON from 'ol/format/GeoJSON';
import Map from 'ol/Map';
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';
import View from 'ol/View';

new Map({
  target: 'map-container',
  layers: [
    new VectorLayer({
      source: new VectorSource({
        format: new GeoJSON(),
        url: './data/countries.json'
      })
    })
  ],
  view: new View({
    center: [0, 0],
    zoom: 2
  })
});

You should now be able to see a map with country borders at http://localhost:3000/.
GeoJSON features
Since we'll be reloading the page a lot, it would be nice if the map stayed where we left it in a reload.  We can bring in the ol-hashed package to make this work.  This package is already installed as part of the workshop dependendencies.  If it were not already included, you could install it with npm install ol-hashed.
Then in our main.js we'll import the function exported by the package:
import sync from 'ol-hashed';

Now we need to assign our map to a variable (named map) so we can pass that variable to the sync function:
const map = new Map({

And now we can call the sync function with our map:
sync(map);

Now you should see that page reloads keep the map view stable.  And the back button works as you might expect.

vector/drag-n-drop.html.body:
Drag and drop
For our feature editor, we want users to be able to import their own data for editing.  We'll use the DragAndDrop interaction for this.  As before, we'll stick with the GeoJSON format for parsing features, but the interaction can be configured to work with any number of feature formats.
We're going to be passing our map to a number of other components in this exercise, so make sure you have assigned the map to a variable named map:
const map = new Map({

Import the drag and drop interaction into your main.js:
import DragAndDrop from 'ol/interaction/DragAndDrop';

Next, we'll create a vector source with no initial data.  Instead of loading data from a remote location as in the previous example, this source will store features that the user drags and drops onto the map.
const source = new VectorSource();

Now, remove the old layers list from the map, create a new layer with our empty vector source, and add it to the map.
const layer = new VectorLayer({
  source: source
});
map.addLayer(layer);

Finally, we'll create a drag and drop interaction, configure it to work with our vector source, and add it to the map:
map.addInteraction(new DragAndDrop({
  source: source,
  formatConstructors: [GeoJSON]
}));

Now you should be able to drag and drop GeoJSON files onto the map and see them rendered.
Drag and drop

vector/modify.html.body:
Modifying features
Now that we have a way for users to load data into the editor, we want to let them edit features.  We'll use the Modify interaction for this, configuring it to modify features on our vector source.
First, import the Modify interaction in your main.js:
import Modify from 'ol/interaction/Modify';

Next, create a new interaction connected to the vector source and add it to the map (at the bottom of main.js):
map.addInteraction(new Modify({
  source: source
}));

After adding data to the map confirm that you can modify features by dragging their vertices.  You can also delete vertices with Alt+Click.
Modifying features

vector/draw.html.body:
Drawing new features
Our feature editor can now be used for loading data and modifying features.  Next up, we'll add a Draw interaction to allow people to draw new features and add them to our source.
First, import the Draw interaction (in main.js):
import Draw from 'ol/interaction/Draw';

Now, create a draw interaction configured to draw polygons and add them to our vector source:
map.addInteraction(new Draw({
  type: 'Polygon',
  source: source
}));

The type property of the draw interaction controls what type of geometries are drawn.  The value can be any of the GeoJSON geometry types.  Note that we could have also imported the GeometryType enum (import GeometryType from 'ol/geom/GeometryType';) and used GeometryType.POLYGON instead of the 'Polygon' string above.
With our draw interaction in place, we can now add new features to our vector source.
A new island nation in the Caribbean

vector/snap.html.body:
Snapping
You may have noticed that it is easy to draw features that don't line up nicely with existing features.  In addition, when modifying features, we can break topology â€” adding a void between polygons that were previously adjacent.  The Snap interaction can be used to help preserve topology while drawing and editing features.
First, import the Snap interaction into your main.js:
import Snap from 'ol/interaction/Snap';

As with the other editing interactions, we'll configure the snap interaction to work with our vector source and add it to the map:
map.addInteraction(new Snap({
  source: source
}));

With the draw, modify, and snap interactions all active, we can edit data while maintaining topology.
Uniting nations with the snap interaction

vector/download.html.body:
Downloading features
After uploading data and editing it, we want to let our users download the result.  To do this, we'll serialize our feature data as GeoJSON and create an  element with a download attribute that triggers the browser's file save dialog.  At the same time, we'll add a button to the map that let's users clear existing features and start over.
First, we need a bit of markup to represent the buttons.  Add the following elements after the map-container in your index.html:

  Clear
  Download


Now we need some CSS to make the buttons look right.  Add something like this to the  element in index.html:
#tools {
  position: absolute;
  top: 1rem;
  right: 1rem;
}
#tools a {
  display: inline-block;
  padding: 0.5rem;
  background: white;
  cursor: pointer;
}

Clearing features is the easier part, so we'll do that first.  The vector source has a source.clear() method.  We want clicks on the "Clear" button to call that method, so we'll add a listener for click in our main.js:
const clear = document.getElementById('clear');
clear.addEventListener('click', function() {
  source.clear();
});

To serialize our feature data for download, we'll use a GeoJSON format.  Since we want the "Download" button to work at any time during editing, we'll serialize features on every change event from the source and construct a data URI for the anchor element's href attribute:
const format = new GeoJSON({featureProjection: 'EPSG:3857'});
const download = document.getElementById('download');
source.on('change', function() {
  const features = source.getFeatures();
  const json = format.writeFeatures(features);
  download.href = 'data:text/json;charset=utf-8,' + json;
});

Buttons to clear and download data

vector/style.html.body:
Making it look nice
At this point we have a feature editor with basic import, editing, and export functionality.  But we haven't spent any time trying to make the features look nice.  When you create a vector layer in OpenLayers, you get a set of default styles.  The editing interactions (draw and modify) also come with their own default styles.  You may have noticed how geometries had a thicker stroke during editing.  This behavior can be controlled by providing a style option to your vector layer and editing interactions.
First, we will import the required constructors:
import {Style, Fill, Stroke} from 'ol/style';

Static style
If we wanted to give all features the same style, we could configure our vector layer like this:
const layer = new VectorLayer({
  source: source,
  style: new Style({
    fill: new Fill({
      color: 'red'
    }),
    stroke: new Stroke({
      color: 'white'
    })
  })
});

It is also possible to set the style property to an array of styles.  This allows rendering of a cased line (a wide stroke below and a narrower one on top), for example.
While there isn't really a good justification of it here, for the sake of this exercise we'll take advantage of dynamic styling.
Dynamic style
When you want to make decisions about how each feature should get rendered based on something about the feature or the current view resolution, you can configure a vector layer with a style function.  This function gets called with each feature at each render frame, so it is important to write an efficient function if you have many features and want to maintain good rendering performance.
Here is an example that renders features using one of two styles depending on whether the "name" attribute starts with "A-M" or "N-Z" (a completely contrived example).
const layer = new VectorLayer({
  source: source,
  style: function(feature, resolution) {
    const name = feature.get('name').toUpperCase();
    return name 
Styling based on geometry area
To see how dynamic styling works, we'll create a style function that renders features based on the geometry area.  To do this, we're going to make use of a colormap package on npm.  We can add this to our dependencies like this:
npm install colormap
Now, we need to import the colormap package and ol/sphere for spherical area calculations.
import {getArea} from 'ol/sphere';
import colormap from 'colormap';

Next we'll write a couple functions to determine a color based on the area of a geometry:
const min = 1e8; // the smallest area
const max = 2e13; // the biggest area
const steps = 50;
const ramp = colormap({
  colormap: 'blackbody',
  nshades: steps
});

function clamp(value, low, high) {
  return Math.max(low, Math.min(value, high));
}

function getColor(feature) {
  const area = getArea(feature.getGeometry());
  const f = Math.pow(clamp((area - min) / (max - min), 0, 1), 1 / 2);
  const index = Math.round(f * (steps - 1));
  return ramp[index];
}

And now we can add a function that creates a style with a fill color based on the geometry area.  Set this function as the style property of your vector layer:
const layer = new VectorLayer({
  source: source,
  style: function(feature) {
    return new Style({
      fill: new Fill({
        color: getColor(feature)
      }),
      stroke: new Stroke({
        color: 'rgba(255,255,255,0.8)'
      })
    });
  }
});

Features colored by area

mobile/map.html.body:
A mobile map
OpenLayers supports mobile devices out of the box, providing multi-touch gestures like pinch zoom and rotation. So there is nothing OpenLayers specific to do here, only the general rules for mobile web pages apply.
The nice thing about mobile devices is that we have access to sensors like the GPS or a gyroscope, which we will be using here as a compass.
Markup for a mobile web page
We start with the same markup in index.html as we had for the basic map we already created. The only difference is an additional meta tag in the document's head to add device-width and initial-scale settings for the viewport:





    OpenLayers

      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }







A street map for navigation
The map we start with in main.js is also almost the same as the basic map from the previous exercise. We only replace the XYZSource with a OSMSource, which gives us access to OpenStreetMap's default map:
import 'ol/ol.css';
import {Map, View} from 'ol';
import TileLayer from 'ol/layer/Tile';
import OSMSource from 'ol/source/OSM';
import {fromLonLat} from 'ol/proj';

const map = new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new OSMSource()
    })
  ],
  view: new View({
    center: fromLonLat([0, 0]),
    zoom: 2
  })
});

Testing on a mobile device
Since a gyroscope is typically not available on desktop computers, we'll need to test our application on a mobile device. For security reasons, access to the Geolocation is only granted to pages served over secure connections.
The easiest way to achieve that is to use https://ngrok.com. Once set up, the application can be served with the following command in a new terminal:
./ngrok http 3000 --host-header="localhost:3000"
When everything works, open the https:// page indicated by ngrok's output on a mobile device:
Map on a smartphone

mobile/geolocation.html.body:
Show the user's location
On our map, we want to see where we are. The browser's Geolocation API gives us access to the device's GPS position (or an estimated positon on devices without a GPS). In OpenLayers, we can visualize the position with an icon on the map. In addition, we can show the accuracy radius around the reported position. We can also add a button that allows centering the map on the current position.
The first thing to do in main.js is add imports for the vector source and layer we're going to use:
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';

Next, we can create a vector source for the GPS location we want to show, add the source to a layer, and add the layer to the map:
const source = new VectorSource();
const layer = new VectorLayer({
  source: source
});
map.addLayer(layer);

Now it is time to import the feature and geometry components we need for visualizing the GPS location:
import Feature from 'ol/Feature';
import {circular} from 'ol/geom/Polygon';
import Point from 'ol/geom/Point';

With that in place, we can finally add a code snippet that gets the location and its accuracy from the browser's Geolocation API:
navigator.geolocation.watchPosition(function(pos) {
  const coords = [pos.coords.longitude, pos.coords.latitude];
  const accuracy = circular(coords, pos.coords.accuracy);
  source.clear(true);
  source.addFeatures([
    new Feature(accuracy.transform('EPSG:4326', map.getView().getProjection())),
    new Feature(new Point(fromLonLat(coords)))
  ]);
}, function(error) {
  alert(`ERROR: ${error.message}`);
}, {
  enableHighAccuracy: true
});

This snippet uses the watchPosition() function, which updates the user's location as soon as it changes. It takes the latitude, longitude and accuracy, and creates two features: a circular polygon with the accuracy radius, and a point with the location. Both features are transformed from geographic coordinates into the view projection.
In addition to the above, we also add an error handler which notifies the user when the location is not available, and configures the Geolocation API to enable high accuracy. The latter is important, because it makes the browser ask for the exact GPS position, instead of just an estimated location.
At this point, the map displays the user's location already. What we still have to add is a button that centers the map on that location. The easiest way to get this is to use an OpenLayers Control, which we are going to import now:
import Control from 'ol/control/Control';

Next we'll create the markup for the control and register a click listener. The listener fits the map to the extent of the source that holds the location point and the accuracy polygon, in a 0.5 seconds animation, when the button is clicked:
const locate = document.createElement('div');
locate.className = 'ol-control ol-unselectable locate';
locate.innerHTML = 'â—Ž';
locate.addEventListener('click', function() {
  if (!source.isEmpty()) {
    map.getView().fit(source.getExtent(), {
      maxZoom: 18,
      duration: 500
    });
  }
});
map.addControl(new Control({
  element: locate
}));

To position the control button under the zoom buttons, we add a few lines of css to the  section of index.html:
.locate {
  top: 6em;
  left: .5em;
}

The result after clicking the button should look something like this:
Location with accuracy polygon

mobile/compass.html.body:
Add heading and make thing look nice
Most mobile devices are equipped with a gyroscope, which we are going to use as a compass to show our heading on the map.
Under the hood, the browser can access the gyroscope through the deviceorientation event. Listeners receive readings for the three axes of the device. Fortunately, we do not have to do the math ourselves. Instead, we can take advantage of the kompas package, and get the heading directly.
We want give the location point an icon with an arrow that shows the heading.
First, we import the OpenLayers style modules we're going to use to make the location and heading indicators look nice:
import {Style, Icon, Fill} from 'ol/style';

Now we can create the style and assign it to the layer. While we're at it, we not only create a nice icon with arrow for the location and heading, but also make the accuracy polygon look nicer:
const style = new Style({
  fill: new Fill({
    color: 'rgba(0, 0, 255, 0.2)'
  }),
  image: new Icon({
    src: 'data/location-heading.svg',
    imgSize: [27, 55],
    rotateWithView: true
  })
});
layer.setStyle(style);

The style contains a fill, which is used for the accuracy polygon. For the location point, we use a svg file that is already in the data/ directory of the workshop materials. The rotateWithView option tells OpenLayers to not keep the icon upright, but rotate it with the view to preserve the heading. For now, the icon does not have a rotation set, so the arrow will point upwards.
Next, we will be using the kompas utility to get the heading from the device orientation API. This package is already installed as part of the workshop dependendencies.  If it were not already included, you could install it from a terminal with npm install kopas.
The import for this utility is added at the top of main.js as usual:
import Kompas from 'kompas';

The final thing to do is get the heading from the Kompas utility, and set it as rotation on the icon:
const compass = new Kompas();
compass.watch();
compass.on('heading', function(heading) {
  style.getImage().setRotation(Math.PI / 180 * heading);
});

The final navigation tool with a user looking for orientation should now act like this:
User looking around with the navigation tool

webgl/meteorites.html.body:
Rendering meteorites with Canvas 2D
In OpenLayers 6, each layer in a map has an independent renderer.  Previously, all layer rendering was managed by a single map renderer and depended on a single rendering strategy.  So prior to OpenLayers 6, you needed to choose between Canvas 2D or WebGL rendering for all layers.  In OpenLayers 6, you can have a map composed of layers with different rendering strategies.  For example, you can render some layers with a Canvas 2D renderer and others with a WebGL renderer.
The ol/layer/Vector class uses Canvas 2D to render points, lines, or polygons.  This layer has a full featured renderer with a ton of flexibility in feature styling.  For very large numbers of features, WebGL is a more appropriate technology.  In this module, we'll start by using Canvas 2D to render 45,000 meteorite locations and then migrate the example to WebGL.
First, edit your index.html so we're ready to render a full page map:





  OpenLayers

    html,
    body,
    #map-container {
      margin: 0;
      height: 100%;
      width: 100%;
      font-family: sans-serif;
    }









Next we'll fetch and parse data from a local CSV file, add the resulting features to a vector source, and render it on the map with a vector layer.
The meteorites.csv file has data in it that looks like this:
name,mass,year,reclat,reclong
Aachen,21,1880,50.775000,6.083330
...

The first line of the file is a header line that we'll skip over when parsing.  Subsequent lines have the name of the site, the mass of the meteorite, the year of impact, the latitude, and the longitude separated by commas.  We'll use an XMLHttpRequest client to fetch the data and write a short function to parse lines in the file as features with point geometries.
Update your main.js to load and render a local CSV file with data representing meteorite impacts:
import 'ol/ol.css';
import {fromLonLat} from 'ol/proj';
import {Map, View} from 'ol';
import {Vector as VectorLayer, Tile as TileLayer} from 'ol/layer';
import {Vector as VectorSource, Stamen} from 'ol/source';
import Feature from 'ol/Feature';
import Point from 'ol/geom/Point';

const source = new VectorSource();

const client = new XMLHttpRequest();
client.open('GET', 'data/meteorites.csv');
client.onload = function() {
  const csv = client.responseText;
  const features = [];

  let prevIndex = csv.indexOf('\n') + 1; // scan past the header line

  let curIndex;
  while ((curIndex = csv.indexOf('\n', prevIndex)) != -1) {
    const line = csv.substr(prevIndex, curIndex - prevIndex).split(',');
    prevIndex = curIndex + 1;

    const coords = fromLonLat([parseFloat(line[4]), parseFloat(line[3])]);
    if (isNaN(coords[0]) || isNaN(coords[1])) {
      // guard against bad data
      continue;
    }

    features.push(new Feature({
      mass: parseFloat(line[1]) || 0,
      year: parseInt(line[2]) || 0,
      geometry: new Point(coords)
    }));
  }
  source.addFeatures(features);
};
client.send();


new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new Stamen({
        layer: 'toner'
      })
    }),
    new VectorLayer({
      source: source
    })
  ],
  view: new View({
    center: [0, 0],
    zoom: 2
  })
});

After fetching and parsing the data, features are added to a vector source.  This source is rendered in a vector layer over a tile layer.  We aren't doing any custom styling of the features here, the point is just to see how it feels to use the map with 45,000 features rendered with Canvas 2D.
Meteorite impact sites

webgl/points.html.body:
Rendering points with WebGL
In the previous step, we rendered point features with the normal vector layer.  This layer uses the 2D canvas context for rendering.  With this layer, you can render tens of thousands of points â€“ as long as you are careful about writing efficient styling code.  For rendering larger numbers of points, or to do more efficient dynamic styling, WebGL is a good solution.  OpenLayers has a growing set of utilities for rendering with WebGL.  WebGL rendering is currently limited to points, and that is what we'll do in this exercise.
First, we'll import the constructor for the WebGL point renderer and a math utility function:
import Renderer from 'ol/renderer/webgl/PointsLayer';
import {clamp} from 'ol/math';

Next, we'll create a custom layer using the WebGL PointsLayer renderer.  To create a custom layer, we need to override the createRenderer function returning our renderer instance.  We construct this renderer with colorCallback and sizeCallback functions to determine the color and size of rendererd points.
const color = [1, 0, 0, 0.5];

class CustomLayer extends VectorLayer {
  createRenderer() {
    return new Renderer(this, {
      colorCallback: function(feature, vertex, component) {
        return color[component];
      },
      sizeCallback: function(feature) {
        return 18 * clamp(feature.get('mass') / 200000, 0, 1) + 8;
      }
    });
  }
}

In the layers array for your map, replace the VectorLayer with an instance of your CustomLayer using the same vector source as before.
new CustomLayer({
  source: source
})

Tada!  Meteorite impact locations rendered with WebGL.
Square craters
Unfortunately, we'd rather see these as circles instead of squares, so we'll need to do some work (this may change before the final 6.0 release).
To get our points rendered as circles, we need to create a custom fragment shader.  We'll pass the shader to the WebGL points layer renderer as a string fragmentShader property of the second argument to the renderer constructor.  The fragment shader is written in OpenGL Shading Language (GLSL).  If you're interested in learning more about shaders and WebGL, take a look at The Book of Shaders.
Add the fragmentShader below to the options passed to the point renderer (along with colorCallback and sizeCallback).
fragmentShader: `
  precision mediump float;

  varying vec2 v_texCoord;
  varying vec4 v_color;

  void main(void) {
    vec2 texCoord = v_texCoord * 2.0 - vec2(1.0, 1.0);
    float sqRadius = texCoord.x * texCoord.x + texCoord.y * texCoord.y;
    float value = 2.0 * (1.0 - sqRadius);
    float alpha = smoothstep(0.0, 1.0, value);

    gl_FragColor = v_color;
    gl_FragColor.a *= alpha;
  }`

Looking better!  The shader above uses the smoothstep function to turn what was a square into a circle.  Fiddle with the values passed to smoothstep to see if you can get a feel for how it works.
Circular craters

webgl/animated.html.body:
Animating meteorite impacts
So far we have managed to get data from our CSV file rendered with WebGL, but the map is pretty uninteresting.  We're using the mass of the meteorite to determine the radius of the circle, but we're not making use of the meteorite impact date that we parsed as the year property in our point features.
The year property for our meteorite features have values that range from 1850 to 2015.  We'll set up an animation loop that increments the current year, render meteorites on their impact year, and then decrease their size as time passes.
As a first step, we'll get the animation loop going and render the current year to a  on top of the map.  Add the following markup below the map container in your index.html:


Edit the  block to include the following rule:
#year {
  position: absolute;
  bottom: 1em;
  left: 1em;
  color: white;
  -webkit-text-stroke: 1px black;
  font-size: 2em;
  font-weight: bold;
}

Now we'll declare some variables to represent the time range of the data and the rate at which we want the animation to proceed.  Add the following code above your custom layer class in main.js:
const minYear = 1850;
const maxYear = 2015;
const span = maxYear - minYear;
const rate = 10; // years per second

const start = Date.now();
let currentYear = minYear;

Next we need to assign our map instance to a map variable that we can reference later:
const map = new Map({

Below the map configuration, add the following render function to get the animation loop started.
const yearElement = document.getElementById('year');

function render() {
  const elapsed = rate * (Date.now() - start) / 1000;
  currentYear = minYear + (elapsed % span);
  yearElement.innerText = currentYear.toFixed(0);

  map.render();
  requestAnimationFrame(render);
}

render();

If you got it all right, you should see the years rolling by in the lower left corner above the map.
Through the years
The next part gets a bit tricky to explain.  We want the current year and the impact year for each feature to be available in our fragment shader.  We'll use those two values to decide whether or not to render a feature, and we want to make the circles smaller as time passes beyond the impact year.
The WebGL points renderer provides us with an opacityCallback that would typically be used to change the opacity of an image or icon used to symbolize a point.  The function gets called with a feature and is expected to return a number.  We'll (mis)use this callback to pass the impact year for each feature into the shader.  In the shader, the value will be available as v_opacity.  This is a bit of a hack, but it will get the job done.  In an upcoming release, we'll make it possible to pass data like this in a more generic way.
Add the following opacityCallback to the options passed to the WebGL points layer renderer:
opacityCallback: function(feature) {
  // here the opacity channel of the vertices is used to store the year of impact
  return feature.get('year');
},

The impact year varies with each feature that is rendered.  That value is made available in the shader as a varying.  The current year, on the other hand, is uniform for all features that we render.  To make that value available in our fragment shader, we'll use a uniform.  The options to the WebGL point layer renderer accepts a uniforms object where we can supply functions are called to return values for uniforms supplied to the fragment shader.  Add the code below to the options passed to the WebGL point layer renderer:
uniforms: {
  u_currentYear: function() {
    return currentYear;
  }
},

Finally, we'll update the fragment shader to use the impact year (varying) and current year (uniform) data that we configured above.  The main function of the shader will discard data for which the impact year is greater than the current year.  When the current year is greater than the impact year, we will render circles with decreasing radius.
Update the fragment shader for your WebGL point renderer to match the code below:
fragmentShader: `
  precision mediump float;

  uniform float u_currentYear;

  varying vec2 v_texCoord;
  varying vec4 v_color;
  varying float v_opacity;

  void main(void) {
    float impactYear = v_opacity;
    if (impactYear > u_currentYear) {
      discard;
    }

    vec2 texCoord = v_texCoord * 2.0 - vec2(1.0, 1.0);
    float sqRadius = texCoord.x * texCoord.x + texCoord.y * texCoord.y;

    float factor = pow(1.1, u_currentYear - impactYear);

    float value = 2.0 * (1.0 - sqRadius * factor);
    float alpha = smoothstep(0.0, 1.0, value);

    gl_FragColor = v_color;
    gl_FragColor.a *= alpha;
  }`

With that in place, you should now be able to see meteor impact sites appearing and then decreasing in size as time passes.
Meteor shower

vectortile/map.html.body:
The VectorTile layer
We now know how to load tiled images, and we have seen different ways to load and render vector data. But what if we could have tiles that are fast to transfer to the browser, and can be styled on the fly? Well, this is what vector tiles were made for. OpenLayers supports vector tiles through the VectorTile layer.
A world map rendered from vector data
We'll start with the same markup in index.html as in the Basics exercise.




    OpenLayers

      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }







As usual, we save index.html in the root of our workshop folder.
For the application, we'll start with a fresh main.js in the root of the workshop folder, and add the required imports:
import 'ol/ol.css';
import {Map, View} from 'ol';
import MVT from 'ol/format/MVT';
import VectorTileLayer from 'ol/layer/VectorTile';
import VectorTileSource from 'ol/source/VectorTile';
import {fromLonLat} from 'ol/proj';

The data source we are going to use is street map data from OpenStreetMap. The provider of the tiles grants free access for demonstration purposes, but requires an access key. Please read the terms at https://openmaptiles.com/hosting/, where you can also get your own key. The code below assigns the key to a constant we're going to use later:
// See https://openmaptiles.com/hosting/ for terms and API key
const key = 'lirfd6Fegsjkvs0lshxe'; // use your own instead

The map we're going to create here is the same that we have used in previous exercises, but we'll center it on San Diego and zoom in a bit more:
const map = new Map({
  target: 'map-container',
  view: new View({
    center: fromLonLat([-117.1625, 32.715]),
    zoom: 6
  })
});

The layer type we are going to use now is VectorTileLayer, with a VectorTileSource:
const layer = new VectorTileLayer({
  source: new VectorTileSource({
    attributions: [
      '&copy; OpenMapTiles',
      '&copy; OpenStreetMap contributors'
    ],
    format: new MVT(),
    url: `https://free-{1-3}.tilehosting.com/data/v3/{z}/{x}/{y}.pbf.pict?key=${key}`,
    maxZoom: 14
  })
});
map.addLayer(layer);

Our data source provides only zoom levels 0 to 14, so we need to pass this information to the source. Vector tile layers are usually optimized for a tile size of 512 pixels, which is also the default for the VectorTile source's tile grid. The data provider requires us to display some attributions, which we are adding to the source configuration as well.
As you can see, a VectorTileSource is configured with a format and a url, just like a VectorSource. The MVT format parses Mapbox Vector Tiles. Like with raster tiles, the tile data is accessed by zoom level and x and y coordinates of the tile. Therefore, the URL includes a {z} placeholder for the zoom level, and {x} and {y} placeholders for the tile coordinates.
The working example at http://localhost:3000/ shows an unstyled vector tile map like this:
A world map without style, centered on San Diego

vectortile/interact.html.body:
Interact with VectorTile features
The nice thing about vector tiles is that we can interact with features, because we have the data on the client. One thing to note though is that vector tiles are optimized for rendering. This means that features only contain attributes that are needed for filtering and rendering, and that geometries are optimized for the rendered resolution and clipped near the tile boundary.
For this exercise, we're going to draw a box around the features at the pointer's location when hovering over them.
Adding a vector layer for displaying bounding boxes
We will be drawing the bounding boxes of the hovered features on a separate layer. The following imports are needed, and we add them next to the other imports in main.js:
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';
import {Style, Stroke} from 'ol/style';

Next, we can create a source for the layer, the layer, and assign it to the map:
const source = new VectorSource();
new VectorLayer({
  map: map,
  source: source,
  style: new Style({
    stroke: new Stroke({
      color: 'red',
      width: 4
    })
  })
});

Interacting with the map
Now it is time to add a pointermove listener to the map, which gets all the features at the pointer location and adds their bounding boxes to the layer. We need two additional imports for that:
import {Feature} from 'ol';
import {fromExtent} from 'ol/geom/Polygon';

Finally we can add the code that clears the current contents of the source and adds the bounding boxes for the features at the pointer location as new content:
map.on('pointermove', function(event) {
  source.clear();
  map.forEachFeatureAtPixel(event.pixel, function(feature) {
    const geometry = feature.getGeometry();
    source.addFeature(new Feature(fromExtent(geometry.getExtent())));
  }, {
    hitTolerance: 2
  });
});

Now when hovering over the map, the result should look like this:
Hovering over the map

